  false,\n\t\"url\": null,\n\t\"notes\": \"This study evaluates the effects of thinning
  regimes designed to accelerate the development of late-successional forest structure
  for the benefit of salmon and other ESA-listed species. The focus is to ensure that
  proposed thinning activities (primarily by federal agencies such as BLM and USFS)
  do not delay the recovery of habitat important to these ESA-listed species. Currently
  thinning actions undertaken by BLM and USFS have resulted in the substantial delay
  in the recovery of instream habitat. The results from this study are intended to
  be provided to these agencies so that they can make management decisions consistent
  with the restoration and recovery of habitat important to ESA-listed species, in
  particular, instream habitat.nnData of DF forest reference stands.\",\n\t\"owner_org\":
